// $ go test -benchmem -bench Benchmark_serveWrite -run=^$ -cpu=1  -cpuprofile=cpu.pprof -memprofile=mem.pprof
// $ go tool pprof -http="127.0.0.1:8080" mem.pprof
// $ go tool pprof -http="127.0.0.1:8081" cpu.pprof
//
//	805585              1508 ns/op            1043 B/op          9 allocs/op
func Benchmark_serveWrite(b *testing.B) {
	conf := `
		tags_ignore = ["a","b","c","d","e","f","g","h","instance"]
		tags_ignore_regex = ["^_a","^_b","^_c","^_d","^_e","^_f","^_g","^_h","^jo","^in"]
		[tags]
		  tag1 = "some_value"
		`

	b.Run("new way", func(b *testing.B) {
		ipt := defaultInput()
		_, err := toml.Decode(conf, ipt)
		require.NoError(b, err)

		feeder := &blankFeeder{}
		ipt.feeder = feeder
		ipt.tagger = &mockTagger{}
		ipt.Run()
		req := &http.Request{
			Method: http.MethodPut,
			URL: &url.URL{
				Path:     "/prom_remote_write",
				RawQuery: "foo=bar&remoteip=1.2.3.4",
			},
			Proto:      "HTTP/1.1",
			ProtoMajor: 1,
			ProtoMinor: 1,
			Header:     make(http.Header),
			Host:       "1.1.1.1",
			Body:       io.NopCloser(bytes.NewReader(mock90pts)),
		}
		res := httpResponseWriter{}

		for i := 0; i < b.N; i++ {
			ipt.serveWrite(res, req)
		}
	})
}

func TestInput_serveWrite(t *testing.T) {
	tests := []struct {
		name     string
		conf     string
		mockByte []byte
		want     []string
	}{
		{
			name:     "01 no tag",
			conf:     ``,
			mockByte: mock90pts,
			want:     want1,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			ipt := defaultInput()
			_, err := toml.Decode(tt.conf, ipt)
			require.NoError(t, err)

			feeder := &mockFeeder{}
			ipt.feeder = feeder
			ipt.tagger = &mockTagger{}
			ipt.Run()
			req := &http.Request{
				Method: http.MethodPut,
				URL: &url.URL{
					Path:     "/prom_remote_write",
					RawQuery: "foo=bar&remoteip=1.2.3.4",
				},
				Proto:      "HTTP/1.1",
				ProtoMajor: 1,
				ProtoMinor: 1,
				Header:     make(http.Header),
				Host:       "1.1.1.1",
				Body:       io.NopCloser(bytes.NewReader(tt.mockByte)),
			}
			res := httpResponseWriter{}

			ipt.serveWrite(res, req)

			got := feeder.GetPoints()

			gotStr := []string{}
			for _, v := range got {
				s := v.LineProto()
				s = s[:strings.LastIndex(s, " ")]
				gotStr = append(gotStr, s)
				fmt.Printf("%q\n", s)
			}

			assert.Equal(t, tt.want, gotStr)
		})
	}
}

